import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes";

const createNote = (note) => {
  return (<Note
    key={note.id}
    title={note.title}
    content={note.content}
  />)
}


function App() {
  return (
    <div>
    {notes.map(createNote)}
      <Header />
      <Note />
      <Footer />
    </div>
  );
}

export default App;
